import { 
  Box,
  Button
} from '@material-ui/core';

import '../styling/remix.css';

import Navigation from './navigation';

import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

import {
  ApolloClient,
  InMemoryCache,
  useMutation,
  gql
} from "@apollo/client";

const client = new ApolloClient({
  uri: 'https://localhost:5000/graphql',
  cache: new InMemoryCache()
});

const CREATE_REMIX = gql`
  mutation CreateRemix($title: String!) {
    createRemix(title: $title) {
      title
    }
  }
`;

const Remix = () => {
  const [createRemix, { data, loading, error }] = useMutation(CREATE_REMIX);
  
  return(
    <Box
      id='remix-window'
    >
    </Box>
    )
}

export default Remix;
